import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./Components/Login";
import { useState, useEffect } from "react";
import { getUsers } from "./Services/UsersService";
import { getAdmins } from "./Services/AdminsService";
import Header from "./Components/Header";
import Footer from "./Components/Footer";

function App() {
  const [type, setType] = useState(0);
  const [users, setUsers] = useState([]);
  const [admins, setAdmins] = useState([]);

  useEffect(() => {
    getUsers().then((res) => {
      setUsers(res.data);
    });

    getAdmins().then((res) => {
      setAdmins(res.data);
    });
  }, []);

  const checkLogin = (guest) => {
    users.forEach((element) => {
      if (element.username === guest.user) {
        if (element.password === guest.pass) setType(1);
      }
    });

    admins.forEach((element) => {
      if (element.username === guest.user) {
        if (element.password === guest.pass) setType(2);
      }
    });
  };

  return (
    <div>
      {type === 0 ? (
        <Login checkLogin={checkLogin} />
      ) : type === 1 ? (
        <Header />
      ) : (
        <Footer />
      )}

      {/* <Router>
        <div className="container">
          <Routes>
            {type === 0 ? (
              <Route path="/" element={<Login checkLogin={checkLogin} />} />
            ) : type === 1 ? (
              <Route path="/admin" element={<Header />} />
            ) : (
              <Route path="/user" element={<Footer />} />
            )}
          </Routes>
        </div>
      </Router> */}
    </div>
  );
}

export default App;
